[Memory addresses]

regex: (\<matplotlib.*)
replace: MATPLOTLIB

regex: (\<AxesSubplot.*)
replace: MATPLOTLIB

regex: (\<Axes:.*)
replace: MATPLOTLIB

regex: (<[a-zA-Z_][0-9a-zA-Z_.]* at )(0x[0-9a-fA-F]+)(>)
replace: \1MEMORY_ADDRESS\3

[Matplotlib figure size]
regex: (\<Figure size .*)
replace: WIDTH_HEIGHT

[Warnings]
regex: (.*UserWarning.*)
replace: USERWARNING

regex: (.*DeprecationWarning.*)
replace: USERWARNING

[Version]
regex: (Using .* version.*)
replace: VERSION

[Dask]
regex: (Client-.*)
replace: CLIENT

regex: (Dashboard: http.*)
replace: SERVER

regex: (Hosting the HTTP server on port.*)
replace: PORT

[Progress Bar]
regex: (\[.*\<.*it\/s\])
replace: BAR

regex: (.*B \[0.*B/s\])
replace: DOWNLOAD

regex: (.*B \[0.*B/s\])
replace: DOWNLOAD

[sklearn]
regex: (WARNING:root:sklearn.*)
replace: SKLEARNWARNING

[parmed openmm ]
regex: (Warning: importing.*)
replace: PARMEDOPENMM

[BIO temporary]
regex: (.*BiopythonDeprecationWarning.*)
replace: BiopythonDeprecationWarning
